import ButtonAppBar from './navbar';
import Testimonials from './Testimonials';
import Hero from './Hero';
import Whoami from './Whoami';
import Services from './Services';
import Price from './Price';
import Processcomponent from './Processcomponent';
import Footer from './footer';
import { Container, useMediaQuery } from '@mui/material';

function App() {
  const isSmallScreen = useMediaQuery('(max-width:600px)'); // Define your breakpoint here

  return (
    <>
      <Container
         maxWidth={false}
        sx={{
          display: 'flex',
          flexDirection: 'column',
          alignItems: 'stretch',
          minHeight: '100vh', // Set the minimum height to 100% of the viewport height
        }}
        style={{ width: '100%', position: 'relative', overflow: 'hidden' }} // Remove absolute positioning and add overflow hidden
      >
        <ButtonAppBar />
        <Hero />
        <Whoami />
        {/* <Processcomponent></Processcomponent> */}
        <Services />
        <Price />
        <Testimonials />
        <Footer />
      </Container>
    </>
  );
}

export default App;
